import { AppBar, styled, Toolbar } from '@mui/material';
import React from 'react'

const StyledToolbar = styled(Toolbar)({
    display: "felx",
    justifyContent:"space-between"
})

export const Navbar = () => {
  return (
    <AppBar position='sticky'>
        <StyledToolbar>
            Navbar
        </StyledToolbar>
        </AppBar>
  )
}

export default Navbar;
